import "./style/General.css"
import "./style/Pix2VoxPage.css"

import NavBar from "./NavBar";

const Pix2VoxPage = () => {
    return (
        <div className="page">
            <NavBar />

            <div className="page-container">
                <div className="content">

                    {/* Summary Section */}
                    <div id="pix-header">
                        <h1> PIX2VOX </h1>
                        <h2> November 2022 </h2>
                        <h2> Python </h2>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Pix2VoxPage;
